ConstValues.value:
"mutation signIn($appId: String!, $instanceId: String!, $authorId: String!, $authType: AuthType!, $authToken: String, $password: String) {
  signin(instanceId: $instanceId, appId: $appId, authorId: $authorId, authType: $authType, authToken: $authToken, password: $password) {
    __typename
    result {
      __typename
      token
    }
    errors
  }
}"

"mutation active($conversationId: String!, $tabActivity: Boolean) {
  active(conversationId: $conversationId, tabActivity: $tabActivity) {
    __typename
    errors
  }
}"

"query Messages($conversationId: String!, $offset: Long!, $entriesPerPage: Int!) {
  messages(conversationId: $conversationId, offset: $offset, entriesPerPage: $entriesPerPage) {
    __typename
    next
    edges {
      __typename
      node {
        __typename
        ...MessageInterface
      }
    }
  }
}"

"fragment MessageInterface on Message {
  __typename
  id
  time
  author {
    __typename
    appId
    userId
    metadata {
      __typename
      firstName
      lastName
      profilePictureUrl
    }
  }
  status
  payload {
    __typename
    ... on Text {
      value
    }
    ... on File {
      fileId
      url
      fileType: type
      dimensions {
        __typename
        width
        height
      }
    }
    ... on Button {
      buttonId
    }
    ... on Announcement {
      text
      visibility
    }
    ... on UrlButtonTemplate {
      message
      caption
      url
    }
    ... on CallButtonTemplate {
      message
      caption
      phoneNumber
    }
    ... on QuickButtonsTemplate {
      message
      buttons {
        __typename
        caption
        buttonId
      }
    }
    ... on PersistentButtonsTemplate {
      message
      buttons {
        __typename
        ... on ActionButtonDefault {
          caption
          buttonId
        }
        ... on ActionButtonUrl {
          caption
          url
        }
        ... on ActionButtonCall {
          caption
          phoneNumber
        }
      }
    }
    ... on ImageTemplate {
      url
      dimensions {
        __typename
        width
        height
      }
      buttons {
        __typename
        ... on ActionButtonDefault {
          caption
          buttonId
        }
        ... on ActionButtonUrl {
          caption
          url
        }
        ... on ActionButtonCall {
          caption
          phoneNumber
        }
      }
    }
    ... on CarouselTemplate {
      ratio
      elements {
        __typename
        title
        subtitle
        imageUrl
        buttons {
          __typename
          ... on ActionButtonDefault {
            caption
            buttonId
          }
          ... on ActionButtonUrl {
            caption
            url
          }
          ... on ActionButtonCall {
            caption
            phoneNumber
          }
        }
      }
    }
    ... on TypingOn {
      placeholder
    }
    ... on LocationTemplate {
      message
    }
    ... on Location {
      latitude
      longitude
    }
    ... on VideoTemplate {
      url
      buttons {
        __typename
        ... on ActionButtonDefault {
          caption
          buttonId
        }
        ... on ActionButtonUrl {
          caption
          url
        }
        ... on ActionButtonCall {
          caption
          phoneNumber
        }
      }
    }
    ... on AudioTemplate {
      url
    }
  }
}"
